    return(
        <div className="box">
        {
          obj1.map((obj, index) => (
            <ExpenseItems
            obj1={obj1}
              key={obj.item}
              place={obj.place}
              date={obj.date}
              item={obj.item}
              cost={obj.cost}
            
            >
              {" "}
              {/* <button onClick={DelclickHandler}>Delete Item</button> */}
            </ExpenseItems>
            
          ))

          
